INSERT INTO `categories` VALUES (1,'All','Your road map to the exciting exploration journey into the fascinating world of internet tests!\r\nHere you can find thousands of tests in more than 20 different categories, and you can choose any of them depending where your interests lay. Fun, personality, IQ tests, love and relationship, quizzes, fan tests - everything is possible on VeryTests.com.','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(2,'Popular','Your road map to the exciting exploration journey into the fascinating world of internet tests!\r\nHere you can find thousands of tests in more than 20 different categories, and you can choose any of them depending where your interests lay. Fun, personality, IQ tests, love and relationship, quizzes, fan tests - everything is possible on VeryTests.com.','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(3,'Funny','Most of us know this situation well: It\'s the weekend and you have free time, but are at a loss for how to spend it. You don\'t feel like reading, watching TV or going out, and you don\'t have any plans with family or friends. You want to do SOMETHING, but what?\r\nNo worries! VeryTests.com has you covered with our Fun Tests category. Instead of giving in to boredom and indecision, take a little time to relax and smile (because you KNOW that relaxing and smiling prolong your life significantly!)','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(4,'For Kids','Welcome to the world of children, their reality, dreams and fantasies! Nowadays the kids are generally very well acquainted with the PC and internet, and it is a perfect opportunity for them to improve and develop their computer skills and meet the heroes of their favorite books, movies or cartoons in these tests. Harry Potter books and movies and Disney fairy tails will probably be the most requested ones, but there is also a choice of interactive knowledge tests developed specially for kids of different age categories. So it is not only a lot of fun for them, but the educational aspect helps to develop their erudition. Let your children discover the diversity of tests on this page now! ','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(5,'Psychology','The world would be a pretty boring place if everyone were the same, right? It\'s obvious that every human being is unique – and not only in physical appearance. Each of us also has a certain personality profile that sets us apart. Taken together, our specific features and characteristics form our complete personality profile.\r\nWant to know YOUR personality profile? Just take the tests and quizzes found here. You can learn so much! For instance, do you share similarities with your favorite celebrity, or maybe with a film or book hero? Find out here! You can also learn which professions would best suit your personality, if you\'re currently trying to make this difficult choice. And wouldn\'t it be fun to know more about your fashion style, or maybe see what animal you could be? There\'s so much to discover about yourself! Believe us, you don\'t know EVERYTHING about yourself yet. VeryTests can help you get started on a journey of self-discovery! ','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(6,'Love','All you need is love, sang The Beatles back in the day. It‘s true that to love and be loved are probably the two most important things in everyone’s life.\r\nBut what should you do if you’re not sure whether you’re in Love with a capital L, or just having a fling on your way to The Real Thing? These tests will help you separate your emotions from your more rational thoughts. Easier said than done, we know... but once you do, you‘ll learn your love’s (or fling’s) true essence. Then you’ll know whether you’re headed for the altar -- or need to update your dating resume.\r\nOr maybe you’re not currently in a relationship, and are just here to test your knowledge. Think you’re an expert on love and sex? Prove it by acing our tests! Find out whether Johnny Depp would be your perfect match (as you’ve always suspected!) or which Harry Potter character would be the best bae. Check it all out here now! ','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(7,'Only for Men','Only for men tests will help you to find out the real truth of yourself! Check it out on VeryTests.com','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(8,'Only for Women','No boys allowed! These quizzes are for girls only! (OK, so maybe boys who TRULY want insight into females can take these quizzes, too – if you PROMISE you\'ll use the 411 constructively.)\r\nSo now that that\'s out of the way, ladies, we\'re so glad you\'re here! At VeryTests.com, we have more than 4,000 quizzes you can take on le sujet de l\'amour. (Pardon our French – we mean the subject of love!) You\'d have to be pretty hardcore to take them all, of course, but we\'re sure you\'ll find at least a few that apply to what\'s going on (or not) in your life.\r\nWhether you\'re here to get information, confirmation or inspiration, there\'s no shortage of interesting femaie-specific quizzes here. Dig in and have fun! ','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(9,'Personality','The world would be a pretty boring place if everyone were the same, right? It\'s obvious that every human being is unique – and not only in physical appearance. Each of us also has a certain personality profile that sets us apart. Taken together, our specific features and characteristics form our complete personality profile.\r\nWant to know YOUR personality profile? Just take the tests and quizzes found here. You can learn so much! For instance, do you share similarities with your favorite celebrity, or maybe with a film or book hero? Find out here! You can also learn which professions would best suit your personality, if you\'re currently trying to make this difficult choice. And wouldn\'t it be fun to know more about your fashion style, or maybe see what animal you could be? There\'s so much to discover about yourself! Believe us, you don\'t know EVERYTHING about yourself yet. VeryTests can help you get started on a journey of self-discovery! ','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(10,'IQ','Have you ever asked yourself, what it intelligence? Intelligence can be described as the ability to have skills, necessary to face the requirements and challenges, which man is daily confronted with. According to the Webster\'s Dictionary, \'intelligence is a capacity to perceive and comprehend meaning, information, news\'. Nowadays a new, more complex and extensive conception of intelligence has been developed, and the determination can be simply expressed as: Intelligence is a skill to solve complex problems in the changing circumstances. One cannot say, that IQ = Intelligence, because not all the aspects of the intelligence can be reliably measured. Intelligence can have different forms, co-existing with each other, and not all of them are easily measurable. Besides, sometimes it is difficult to place certain expressions of intelligence (like intuition) into one or another category. Want to know more about the IQ and find out how smart you are? Reveal the intelligence mysteries on this page now! ','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(11,'Actor','A lot of tests about your knowledge of your favorite actors on VeryTests.com','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(12,'Books','A lot of tests about your knowledge of your favorite books on VeryTests.com','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(13,'Career','Almost all of us spend a significant part of the day at their work or at school studying to get a job in the future. So job and career play an important role in our life. But the job should not always be only the income source. If you have a good match, your job will give you pleasure and satisfaction. Maybe it is time to test your career development and - who knows - find out that you are up to the new challenge? Whether you\'re looking for part time jobs or a career as the CEO of a major corporation, the tests and quizzes on this page will help you with this, as well as with the difficult matter of profession choice. You can also test your professional knowledge in certain fields and learn about your management skills potential. Don\'t miss this opportunity to enrich your - office life - and explore Career page of our site! ','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(14,'EQ','Emotional intelligence is a very recently described intelligence form. This concept exists since 80th years of the twentieth century. In summary, emotional intelligence is the ability to sense, understand, and effectively apply the power and acumen of emotions as a source of human energy, information, connection and influence. The following skills belong to the highly developed emotional intelligence: independence from your own feelings and ability to adjust yourself to them, ability to recognize, name and direct your feelings, discern the nuances of feelings and use them in positive way, and, as a consummation, derive actions from it. Emotional intelligence accompanies our daily life and in many cases as important as the common intelligence, especially in our modern society. Wonder if you are able to deal with your feelings and emotions - test your EQ here! ','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(15,'Fan','We all have different hobbies and like different things. If you like movies and TV art, you can find tests and quizzes about your favorite TV-shows and series, popular movies and famous actors. See how much you know about this! Cannot imagine your life without music - hundreds of tests about various music styles, bands and singers are waiting for you! If you are a fanatic sport supporter - test what you really know about one or another sport. There are plenty of tests for anime and manga fans, gamers and book lovers. Just go and search for the category you would like to test your knowledge in and prove that you are a real fan!','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(16,'Fan Fiction','A lot of fan fiction tests on VeryTests.com','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(17,'Game','A lot of tests about your knowledge of your favorite video games on VeryTests.com','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(18,'Health','It is often said that as long as you have health the rest you can buy. It is true to the certain extent - good health is a basis of our normal life. What do we need to do to keep ourselves fit and dynamic? What kind of food is healthy and what ingredients we should better avoid? Do diets and making sport always have positive effect on our body?\r\nThink you have a healthy way of life - test yourself now! Or consider yourself an expert in the field of healthy nutrition - welcome to our internet page with a collection of the health tests and quizzes and enjoy your time here. ','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(19,'Knowledge','Did you know that knowledge is an irreplaceable part and a form of intelligence? Without a certain level of general knowledge, or, in other words, erudition, it is impossible to use the intelligence. Knowledge is the most important and necessary component of success in all the professional fields. Here you can test your knowledge in different categories: from the school disciplines such as mathematics, chemistry or geography to the art and culture, including movies and music. Do you love animals - test how much you know about your favorite one! Fond of computer and everything related to it - go ahead! The possibilities are unlimited! Test yourself with this tests, quizzes and trivia. ','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(20,'Language','The correct use of language is extremely important for the fast and confident communication and understanding with your speaking partner in daily life. Moreover, for many professions it is a crucial instrument - think about teachers and docents, communication specialists, translators and interpreters, TV- and radio show-men, politicians, guides and many others. And the knowledge of at least one foreign language is a great advantage for you not only during vacation in another country, but also in your career development. Here you can test your level of English as native or foreign language and check your skills in German, French, Spanish, Italian, Latin and even Russian with our tests and quizzes! ','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(21,'Movie','What\'s the most fun thing you can do in the dark with your clothes on? Go to see movies, of course! (No-brainer, right? )\r\nAnd what\'s the most fun thing you can do with movies without actually watching them? Take quizzes on AllTheTests.com about the movies you\'ve already seen! (In our humble opinion, anyway. )\r\nWhether you\'re a movie maniac who darkens the cineplex door to catch new releases every weekend, are a Superfan of specific movies, or you just catch flicks on a streaming service when you\'re bored or find the time, you\'ll find fun movie quizzes here. You can even challenge your friends to beat your scores! Have fun! ','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(22,'Music','Are you a music snob? Do you scoff at friends whose tastes in music are just so...pitifully MAINSTREAM? That bad attitude could come in handy for once! Here you\'ll find a gazillion quizzes about many different types of music...more than you could probably take in a year. (We would never discourage you from trying, though!) You might think you know it all when it comes to your fave type(s) of music – but with all due respect, we doubt it. ;) Take a few quizzes and see how much you REALLY know!\r\nOr... you might be the type of music lover who\'ll play anything as long as it gets you moving...tapping your toes, snapping your fingers or busting out into full-on dance mode! There are lots of great quizzes here for you, too, Dance Machine!\r\nOr...you might even be one who doesn\'t care about the beat – it\'s the words that do it for you. We recommend some Leonard Cohen, Mr./Ms. Deep Thinker! And of course, that you look through the quizzes here and try your luck at the ones that strike your fancy.\r\nHave fun, music fan! If you\'re game, challenge your friends to beat your scores! ','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(23,'Purity','There is another way to test yourself - to find out how pure you are. Are you a beginner in love matters or a sex god? Are you very naughty or ultimately modest? Do you behave decently or a very mean person? Further, by taking the tests on this page you can see if you are completely obsessed with Internet, your favorite pop-idol or one of the popular books, comics or movies. It cannot be simpler - by clicking \'yes\' or \'no\' and therewith choosing one of the answers you will know the truth about yourself in almost no time. Recommended for those who like short and clear questions and answers. ','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(24,'Sport','A lot of sport tests on VeryTests.com','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(25,'Think','Here you can find out if your memory and your brains are trained and fit enough. There are different ways to do it: interactive games to test your skills and logic, memory tests with different subjects, quizzes and riddles. But it is not only for fun, many of the tests on this page you can successfully use as the preparation for other, more serious challenges. For example, for the IQ-test or any assessment while looking for a job or striving to get a promotion. But even if it is not the case, we encourage you to test your memory and thinking skills just for your own self-esteem and development. ','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(26,'TV','We like big brains and we cannot lie - we know YOUR big brain is full of knowledge about your favorite TV shows! You\'ll find at least some of those here in our TV Shows Quizzes section (which, incidentally, might be the best thing to EVER happen to fans of the boob tube, if we may say so ourselves ;).\r\nFrom America\'s Next Top Model and Buffy the Vampire Slayer to The Wizards of Waverly Place and Zoey 101, we have literally thousands of quizzes for dozens of shows. Remember what Chandler\'s mom did for a living? We swear there\'s a quiz with that question! Know which wannabe won America\'s Top Model on Season Two? Strut that savvy right here!\r\nWhatever your favorite shows - because who can choose just one? - it\'s pretty likely you\'ll find many quizzes you\'ll ace in this section. Think we\'re exaggerating? Take a look right now! Have fun (and maybe challenge a friend or two to beat your score)! ','An Exciting Exploration into your Personality and IQ on VeryTests.com'),(27,'Youtube','Before YouTube came on the scene, fandom was mostly limited to superstars - athletes, singers, musicians, actors - and to a lesser degree, TV hosts, journalists and a few activists and scientists.\r\nWe say, BOR-ing! Now, YouTube makes it possible to be a fan of some truly unique and interesting - and unlikely - quasi-celebrities. Like the incomparable ItsFunneh...the bizarre Jack Septiceye...the precocious and talented JoJo Siwa and Annie LeBlanc and more...all YouTubers who might never have become famous but for the reach and popularity of social media.\r\nWhoever you\'re a fan of on YouTube, there\'s a quiz or quizzes you can take in this section to test how super of a fan you truly are. If you\'re like us, you probably have way more than one. So you\'d better get started! ','An Exciting Exploration into your Personality and IQ on VeryTests.com');
